import{a as t,c as i,b as e,_ as r}from"./Rachel-DuDI02rQ.js";import{_ as a,a as s}from"./Ross-Bkw7g7cg.js";import{_ as o}from"./Customer-DK2WKqhH.js";import{_ as l}from"./Frannie-IYBCHQdq.js";import{_ as n,c as g,e as d,o as m}from"./app-BGm9cdBh.js";const c={};function u(p,h){return m(),g("div",null,h[0]||(h[0]=[d('<blockquote><p>The One With All The Cheesecakes</p></blockquote><blockquote><p>Written by: Shana Goldberg-Meehan Transcribed by: Eric Aasen With Help from: Aaron Howard-Miller</p></blockquote><blockquote><p>[Scene: Chandler and Monica‘s, Chandler is sitting at the kitchen table eating cheesecake. The box it came in is also on the table.]</p></blockquote><p><img src="'+t+'" alt="Chandler" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Chandler</strong> : Ohh. Mmm.</p><p><img src="'+i+'" alt="Rachel" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Rachel</strong> : (Comes in the front door and walks towards the kitchen.) Hi.</p><p><img src="'+t+'" alt="Chandler" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Chandler</strong> : Hey, you have got to try this cheesecake.</p><p><img src="'+i+'" alt="Rachel" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Rachel</strong> : Oh, y‘know I&#39;m not that much of a sweet tooth. I(Chandler puts a forkful of the cheesecake in her mouth.)Wow. My God, so creamy. Oh my God, this is the best cheesecake I have ever had. Where did you get this? (She reaches over to look at the label on the box.)</p><p><img src="'+t+'" alt="Chandler" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Chandler</strong> : (nervously) It was at the front door. When I got home. Somebody sent it to us.</p><p><img src="'+i+'" alt="Rachel" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Rachel</strong> : Chandler, this is not addressed to you. This is addressed to Mrs. Braverman downstairs. (Gasping) Thief.</p><p><img src="'+t+'" alt="Chandler" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Chandler</strong> : Ino! I didn&#39;t read the box before I opened it. And you can&#39;t return a box after you&#39;ve opened the box.</p><p><img src="'+i+'" alt="Rachel" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Rachel</strong> : Why, why not?</p><p><img src="'+t+'" alt="Chandler" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Chandler</strong> : Because it&#39;s too delicious.</p><p><img src="'+i+'" alt="Rachel" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Rachel</strong> : Chandler, you stole this cheesecake. That is wrong.</p><p><img src="'+t+'" alt="Chandler" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Chandler</strong> : No-no-no! It is going to be okay, because Mrs. Braverman is gonna send away for a free one and that way we all win! The only losers are the big cheesecake conglomerate, (Reading the label) Momma‘s Little Bakery. (Pause) I feel terrible, I‘m a horrible, horrible, horrible person.</p><p><img src="'+i+'" alt="Rachel" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Rachel</strong> : (taking a bite) Oh, I‘m sorry, what?</p><blockquote><p>Opening Credits</p></blockquote><blockquote><p>[Scene: Central Perk, everyone except Rachel is there as Joey gets up and starts putting on his coat.]</p></blockquote><p><img src="'+a+'" alt="Joey" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Joey</strong> : All right, I should get going, big day at work. Y‘know I‘m in a coma? Today, they do this test on me and it turns out I‘m not brain dead.</p><p><img src="'+t+'" alt="Chandler" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Chandler</strong> : So</p><p><img src="'+a+'" alt="Joey" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Joey</strong> : Ah-ah-ah Mr. Smartie Pants, it‘s just my character that‘s not brain dead. Hey, so Pheebs, we still on for tonight?</p><p><img src="'+e+'" alt="Phoebe" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Phoebe</strong> : Absolutely!</p><p><img src="'+a+'" alt="Joey" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Joey</strong> : I‘ll see you at 8</p><p><img src="'+e+'" alt="Phoebe" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Phoebe</strong> : Okay. (Joey exits.)</p><p><img src="'+t+'" alt="Chandler" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Chandler</strong> : Oh, what‘s at 8</p><p><img src="'+e+'" alt="Phoebe" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Phoebe</strong> : Oh, I have dinner plans with Joey. We get together about once a month to discuss the rest of you guys.</p><p><img src="'+s+'" alt="Ross" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Ross</strong> : Wow, did not know that! May I say how lovely you look today?</p><p><img src="'+e+'" alt="Phoebe" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Phoebe</strong> : Duly noted.</p><p><img src="'+s+'" alt="Ross" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Ross</strong> : Thanks. (Phoebe gets up to get a refill.) (To Monica) Oh! So for tomorrow, do you want to rent a car and drive down together or what?</p><p><img src="'+r+'" alt="Monica" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Monica</strong> : What are you talking about?</p><p><img src="'+s+'" alt="Ross" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Ross</strong> : Cousin Frannie‘s wedding, it&#39;s tomorrow night.</p><p><img src="'+r+'" alt="Monica" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Monica</strong> : You were invited?!</p><p><img src="'+s+'" alt="Ross" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Ross</strong> : No.</p><p><img src="'+r+'" alt="Monica" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Monica</strong> : My God, I can‘t believe this! I mean I knew that mom and dad were invited, but I thought that was it! I mean from the ages 7 to 9 Frannie and I were inseparable!</p><p><img src="'+t+'" alt="Chandler" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Chandler</strong> : Well, maybe since the age of 9, Frannie‘s made some new friends.</p><p><img src="'+s+'" alt="Ross" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Ross</strong> : Well l-look okay, it‘s probably just a mistake. Let me call Aunt Sheryl okay? Maybe you are invited and the invitation just got lost in the mail.</p><p><img src="'+r+'" alt="Monica" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Monica</strong> : Yeah, well you call her and tell her that y‘know when we were kids her precious little Frannie tried to undress me several times, okay? And if I hadn‘t have stopped her, there probably wouldn‘t even be a wedding to go to.</p><p><img src="'+s+'" alt="Ross" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Ross</strong> : Y‘know, she tried to undress me too.</p><p><img src="'+t+'" alt="Chandler" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Chandler</strong> : I used to undress my cousin Glenn. (Monica looks at him then shushes him.)</p><blockquote><p>[Scene: Joey and Rachel&#39;s, Monica, Chandler, Rachel, and Ross are playing Monopoly as Phoebe enters angrily.]</p></blockquote><p><img src="'+e+'" alt="Phoebe" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Phoebe</strong> : Joseph Francis Tribbiani are you home yet?!!</p><p><img src="'+i+'" alt="Rachel" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Rachel</strong> : Umm, I think he‘s still out. What‘s wrong?</p><p><img src="'+e+'" alt="Phoebe" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Phoebe</strong> : Well, I‘ll tell you Rachel Karen Green, I had plans with Joey tonight and he left me this note. (Hands it to Rachel.)</p><p><img src="'+i+'" alt="Rachel" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Rachel</strong> : (reading the note) &quot;Pheebs, can‘t make it, got a date. Talk to you later. Big Daddy.&quot; (Laughs) Big Daddy?</p><p><img src="'+e+'" alt="Phoebe" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Phoebe</strong> : Oh that‘s a nickname we were trying out.</p><p><img src="'+s+'" alt="Ross" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Ross</strong> : Hey, y‘know what nickname never caught on? The Ross-A-Tron! (Monica shakes her head in disgust.)</p><p><img src="'+a+'" alt="Joey" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Joey</strong> : (entering) Hey!</p><p><img src="'+e+'" alt="Phoebe" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Phoebe</strong> : Oh! Here‘s Joseph Francis!</p><p><img src="'+a+'" alt="Joey" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Joey</strong> : Oh-Wha-Ho! What are you middle naming me for?! I left you a note!</p><p><img src="'+e+'" alt="Phoebe" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Phoebe</strong> : So what?! That doesn‘t give you the right to ditch me!</p><p><img src="'+a+'" alt="Joey" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Joey</strong> : Hey, you can cancel plans with friends if there is the possibility for sex!</p><p><img src="'+s+'" alt="Ross" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Ross</strong> : Phoebe he‘s right, that is the rule.</p><p><img src="'+e+'" alt="Phoebe" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Phoebe</strong> : I don‘t accept this rule. When we make plans, I expect you to show up. Okay, I can‘t just be a way to kill time til you meet someone better! Y‘know boyfriends and girlfriends come and go, but this (Motions that their friendship) is for life!</p><p><img src="'+a+'" alt="Joey" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Joey</strong> : Wow! I‘m so sorry; I had no idea it would bother you this much.</p><p><img src="'+e+'" alt="Phoebe" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Phoebe</strong> : Well, it does.</p><p><img src="'+a+'" alt="Joey" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Joey</strong> : Okay, can I-can I make it up to you? Huh? I‘m sorry. (They hug.) How about uh, dinner tomorrow night?! I‘ll pay for myself!</p><p><img src="'+e+'" alt="Phoebe" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Phoebe</strong> : Okay, you wore me down.</p><p><img src="'+s+'" alt="Ross" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Ross</strong> : Hey Joe, while you‘re over there how about another beer for the Ross-A-Tron?</p><p><img src="'+a+'" alt="Joey" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Joey</strong> : The RossIs that back?!! (Chandler motions no.)</p><blockquote><p>[Scene: Monica and Chandler&#39;s, Rachel enters to find Chandler staring at another cheesecake box.]</p></blockquote><p><img src="'+i+'" alt="Rachel" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Rachel</strong> : Hi!</p><p><img src="'+t+'" alt="Chandler" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Chandler</strong> : Another cheesecake came! They delivered it to the wrong address again!</p><p><img src="'+i+'" alt="Rachel" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Rachel</strong> : So just bring it back downstairs, what‘s the problem?</p><p><img src="'+t+'" alt="Chandler" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Chandler</strong> : I can‘t seem to say goodbye.</p><p><img src="'+i+'" alt="Rachel" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Rachel</strong> : Are you serious?! Chandler, we ate an entire cheesecake two days ago and you want more?</p><p><img src="'+t+'" alt="Chandler" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Chandler</strong> : Well I‘ve forgotten what it tastes like okay?!</p><p><img src="'+i+'" alt="Rachel" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Rachel</strong> : It was cheesecake. It was fine. It had a buttery, crumbly, graham cracker crust, with a very rich yet light, cream cheese filling (Pause) Wow! My whole mouth just filled with saliva!</p><p><img src="'+t+'" alt="Chandler" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Chandler</strong> : (closing the box) Y‘know what? Forget it! We are just hungry! We have not had lunch! We are just light-headed! So let us go out and have lunch and forget about the cheesecake.</p><p><img src="'+i+'" alt="Rachel" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Rachel</strong> : Yeah and we‘ll drop it off downstairs so that we‘re not tempted.</p><p><img src="'+t+'" alt="Chandler" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Chandler</strong> : Good idea. Where do you want to go to lunch?</p><p><img src="'+i+'" alt="Rachel" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Rachel</strong> : Momma‘s Little Bakery, Chicago, Illinois. (They exit with the cheesecake.)</p><blockquote><p>[Scene: Central Perk, Monica and Joey are there. Joey is reading a newspaper.]</p></blockquote><p><img src="'+a+'" alt="Joey" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Joey</strong> : Awww! Mel Torme died.</p><p><img src="'+r+'" alt="Monica" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Monica</strong> : Joey, that paper‘s like a year old!</p><p><img src="'+a+'" alt="Joey" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Joey</strong> : Aw! Does that mean the Sam Goody‘s sale is over?!</p><p><img src="'+s+'" alt="Ross" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Ross</strong> : (entering) Hey.</p><p><img src="'+a+'" alt="Joey" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Joey</strong> : Hey.</p><p><img src="'+r+'" alt="Monica" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Monica</strong> : Hey.</p><p><img src="'+s+'" alt="Ross" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Ross</strong> : So I finally heard back from Aunt Sheryl and apparently it wasn‘t a mistake. Ahh, there‘s-there‘s limited seating in the hall.</p><p><img src="'+r+'" alt="Monica" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Monica</strong> : Limited seating?! (Screechingly) I am just one tiny person!</p><p><img src="'+s+'" alt="Ross" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Ross</strong> : Well yeah, but she doesn‘t know that. I mean, the last time she saw you-you would‘ve turned one of those little wedding chairs into kindling.</p><p><img src="'+r+'" alt="Monica" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Monica</strong> : (disgusted) Limited seating! Oh, that is such a lame excuse! That‘s not the reason she‘s not inviting me!</p><p><img src="'+s+'" alt="Ross" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Ross</strong> : Oh what‘s the big deal?! I wasn‘t even invited to the ceremony, just the reception. And-and y‘know what? If it makes you feel any better, Joan and I will just make an appearance and then, and then we‘ll-we‘ll leave early as a sign of protest.</p><p><img src="'+r+'" alt="Monica" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Monica</strong> : Joan?</p><p><img src="'+s+'" alt="Ross" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Ross</strong> : Yeah, Joan Tedeski my date. She‘s an assistant professor in the Linguistics department. Tall, very beautiful, and despite what some people say, not broad backed!</p><p><img src="'+r+'" alt="Monica" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Monica</strong> : Wait a minute, you got Ross Gellar and guest?! I wasn‘t invited and you got &quot;and guest?!&quot;</p><p><img src="'+a+'" alt="Joey" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Joey</strong> : Uh-uh, excuse me, I do have to interrupt on Ross‘s behalf. I-I think the rule applies here y‘know, since she has a chance to get on broad back</p><p><img src="'+s+'" alt="Ross" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Ross</strong> : (interrupting) Not broad backed!</p><p><img src="'+r+'" alt="Monica" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Monica</strong> : Wait a minute, y‘know, you‘re bringing me!</p><p><img src="'+s+'" alt="Ross" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Ross</strong> : What? I can‘t cancel on Joan!</p><p><img src="'+r+'" alt="Monica" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Monica</strong> : Why not?!</p><p><img src="'+s+'" alt="Ross" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Ross</strong> : BecDid you not hear me?! She‘s an assistant professor in the Linguistics department, okay? They‘re wild! Why do you want to come anyway?</p><p><img src="'+r+'" alt="Monica" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Monica</strong> : Because! She‘s my cousin. I mean, we grew up together! We‘re family y‘know? Well that‘s important to me.</p><p><img src="'+s+'" alt="Ross" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Ross</strong> : Okay, all right, I‘ll take you. I‘ll go call Joan. (Does so.)</p><p><img src="'+a+'" alt="Joey" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Joey</strong> : Aww that‘s nice. Family should be there, huh? This is her wedding, happiest day of her life.</p><p><img src="'+r+'" alt="Monica" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Monica</strong> : (laughs) We‘ll see.</p><blockquote><p>[Scene: The Lobby of Chandler and Rachel‘s building, Chandler and Rachel are returning from lunch.]</p></blockquote><p><img src="'+t+'" alt="Chandler" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Chandler</strong> : Well, thank you for lunch.</p><p><img src="'+i+'" alt="Rachel" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Rachel</strong> : What? Wait a minute, I didn‘t pay, I thought you paid!</p><p><img src="'+t+'" alt="Chandler" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Chandler</strong> : So apparently we just don‘t pay for food anymore. (Rachel laughs then Chandler notices something.) Do you see what I see?</p><p><img src="'+i+'" alt="Rachel" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Rachel</strong> : (gasps) Its still there! (The cheesecake they returned to Mrs. Braverman is still lying in front of her door.)</p><p><img src="'+t+'" alt="Chandler" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Chandler</strong> : Mrs. Braverman must be out. (They move closer to it.)</p><p><img src="'+i+'" alt="Rachel" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Rachel</strong> : She could be out of town. Maybe she‘ll be gone for months.</p><p><img src="'+t+'" alt="Chandler" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Chandler</strong> : By then, the cheesecake may have gone bad. We don‘t want her to come back to bad cheesecake.</p><p><img src="'+i+'" alt="Rachel" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Rachel</strong> : No that could kill her.</p><p><img src="'+t+'" alt="Chandler" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Chandler</strong> : Well, we don‘t want that.</p><p><img src="'+i+'" alt="Rachel" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Rachel</strong> : No, so we‘re protecting her.</p><p><img src="'+t+'" alt="Chandler" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Chandler</strong> : But we should take it.</p><p><img src="'+i+'" alt="Rachel" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Rachel</strong> : But we should move quick.</p><p><img src="'+t+'" alt="Chandler" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Chandler</strong> : Why?</p><p><img src="'+i+'" alt="Rachel" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Rachel</strong> : Because I think I just heard her moving around in there.</p><p><img src="'+t+'" alt="Chandler" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Chandler</strong> : Go! Go! Go! Go! Go! Go! Go! Go! Go! Go! (Rachel grabs the cheesecake and they take off upstairs.)</p><blockquote><p>[Scene: Central Perk, Monica and Phoebe are entering. As Phoebe is sitting down, she recognizes someone sitting at the counter.]</p></blockquote><p><img src="'+e+'" alt="Phoebe" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Phoebe</strong> : (gasps) (whispering) Oh my God! That‘s David!</p><p><img src="'+r+'" alt="Monica" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Monica</strong> : David who?</p><p><img src="'+e+'" alt="Phoebe" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Phoebe</strong> : David the scientist guy, David that I was in love with, David who went to Russia and broke my heart David!</p><p><img src="'+o+'" alt="David" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>David</strong> : (noticing Phoebe) Oh my God!</p><p><img src="'+e+'" alt="Phoebe" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Phoebe</strong> : Oh, you say someone‘s name enough, they turn around.</p><p><img src="'+o+'" alt="David" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>David</strong> : Phoebe?</p><p><img src="'+e+'" alt="Phoebe" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Phoebe</strong> : David! (He kisses her cheek) What-what are you doing here? Aren‘t you supposed to be in Russia?</p><p><img src="'+o+'" alt="David" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>David</strong> : Yeah, I‘m just, I‘m just in town for a conference. Umm, God you look phenomenal!</p><p><img src="'+e+'" alt="Phoebe" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Phoebe</strong> : Well Yeah. You look great too. Did you get a haircut?</p><p><img src="'+o+'" alt="David" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>David</strong> : Yeah. Well I-I got like thirty of them.</p><p><img src="'+e+'" alt="Phoebe" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Phoebe</strong> : Yeah.</p><p><img src="'+o+'" alt="David" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>David</strong> : Umm, look I-I-I got a confession to make</p><p><img src="'+e+'" alt="Phoebe" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Phoebe</strong> : Uh-huh.</p><p><img src="'+o+'" alt="David" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>David</strong> : Uh, I-I-I was hoping to run into you here. I didn‘t know whether I should call or not, y‘know I-I was only in town for a few days. And y‘know, I didn‘t want to intrude on your life or-or anything like that, but I-I really wanted to see you andbut I didn‘t know if you wanted to see me.</p><p><img src="'+e+'" alt="Phoebe" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Phoebe</strong> : Well, of course I would want to see you. II think about you all the time.</p><p><img src="'+o+'" alt="David" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>David</strong> : Really? Because I think about you all the time.</p><p><img src="'+e+'" alt="Phoebe" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Phoebe</strong> : Really?</p><p><img src="'+o+'" alt="David" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>David</strong> : I mean, there‘s a statue in Minsk</p><p><img src="'+e+'" alt="Phoebe" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Phoebe</strong> : Uh-huh.</p><p><img src="'+o+'" alt="David" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>David</strong> : That reminds me of you so much, I mean umm, it-it‘s actually of Lenin. But, y‘know at certain angles</p><p><img src="'+e+'" alt="Phoebe" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Phoebe</strong> : Yeah.</p><p><img src="'+o+'" alt="David" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>David</strong> : Umm, anywayDo you want to have dinner tonight?</p><p><img src="'+e+'" alt="Phoebe" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Phoebe</strong> : (excited) Yes! Oh no!</p><p><img src="'+o+'" alt="David" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>David</strong> : (disappointed) Oh. Uh, what?</p><p><img src="'+e+'" alt="Phoebe" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Phoebe</strong> : I can‘t. I can‘t believe I have plans, I can‘t. Can you do it tomorrow night though?</p><p><img src="'+o+'" alt="David" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>David</strong> : Uh no, I have to go in a few hours. I have to be on the red-eye. Well listen, y‘know, next time you‘re in Minsk umm</p><p><img src="'+r+'" alt="Monica" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Monica</strong> : Phoebe, can I talk to you for a second?</p><p><img src="'+e+'" alt="Phoebe" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Phoebe</strong> : Uh-huh. (They go over and talk.)</p><p><img src="'+r+'" alt="Monica" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Monica</strong> : What are you doing?</p><p><img src="'+e+'" alt="Phoebe" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Phoebe</strong> : Well, I have plans with Joey tonight.</p><p><img src="'+r+'" alt="Monica" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Monica</strong> : So! He‘ll understand!</p><p><img src="'+e+'" alt="Phoebe" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Phoebe</strong> : No he won‘t. And that‘s not even the point! Monica, I made a whole speech about you do not cancel plans with friends! And now y‘know what? Just because, potentially, the love of my life comes back from Russia just for one night, I-I should change my beliefs?! I should change beliefs! No! No! No, if I don‘t have my principles, I don‘t have anything!</p><p><img src="'+r+'" alt="Monica" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Monica</strong> : God, you are so strong.</p><p><img src="'+e+'" alt="Phoebe" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Phoebe</strong> : Or! I should rush through dinner with Joey and I can meet David at 9</p><blockquote><p>Commercial Break</p></blockquote><blockquote><p>[Scene: Joey and Rachel&#39;s, Rachel and Chandler are eating the cheesecake right out of the box.]</p></blockquote><p><img src="'+i+'" alt="Rachel" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Rachel</strong> : (taking a bite) Oh my God! That is so good!</p><p><img src="'+t+'" alt="Chandler" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Chandler</strong> : I‘m full, and yet I know if I stop eating this, I‘ll regret it.</p><p><img src="'+a+'" alt="Joey" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Joey</strong> : (entering) Hey!</p><p><img src="'+i+'" alt="Rachel" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Rachel</strong> : Hey!</p><p><img src="'+a+'" alt="Joey" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Joey</strong> : (seeing what they‘re doing) What do you got there?</p><p><img src="'+i+'" alt="Rachel" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Rachel</strong> : Oh it‘s umm, it‘s tofu cake. Do you want some? (He makes a disgusted noise and heads for his room, Chandler follows him in.)</p><p><img src="'+t+'" alt="Chandler" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Chandler</strong> : What are you doing tonight?</p><p><img src="'+a+'" alt="Joey" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Joey</strong> : Huh? Uh (He starts taking off his pants.)</p><p><img src="'+t+'" alt="Chandler" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Chandler</strong> : Dude! Dude! (Motions that Joey should pull up his pants.)</p><p><img src="'+a+'" alt="Joey" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Joey</strong> : Oh! (Pulls up his pants.) Sorry. Uh, I‘ve got those plans with Phoebe, why?</p><p><img src="'+t+'" alt="Chandler" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Chandler</strong> : Oh really? Uh, Monica said she had a date at 9</p><p><img src="'+a+'" alt="Joey" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Joey</strong> : What?! Tonight?!</p><p><img src="'+t+'" alt="Chandler" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Chandler</strong> : That‘s what Monica said.</p><p><img src="'+a+'" alt="Joey" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Joey</strong> : After she gave me that big speech?! She goes and makes a date with a guy on the same night she has plans with me? I think she‘s trying to pull a fast one on Big Daddy!</p><blockquote><p>[Scene: Cousin Frannie‘s Wedding Reception, Monica and Ross are entering and finding their table.]</p></blockquote><p><img src="'+s+'" alt="Ross" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Ross</strong> : Oh here, I think this is us. (Reading the name cards.) Yeah.</p><p><img src="'+r+'" alt="Monica" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Monica</strong> : Limited seating my ass. Let‘s see who made the cut. (To the couple sitting to her right.) Hi!</p><p><img src="'+o+'" alt="The Wedding Guest" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>The Wedding Guest</strong> : Hi!</p><p><img src="'+r+'" alt="Monica" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Monica</strong> : I‘m Monica Gellar. Who do you know the bride and groom?</p><p><img src="'+o+'" alt="The Wedding Guest" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>The Wedding Guest</strong> : Oh, I used to work with Frannie.</p><p><img src="'+r+'" alt="Monica" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Monica</strong> : Used to work with her. Used to! I‘m a relative and I didn‘t get invited! A blood relative! Blood!!</p><p><img src="'+s+'" alt="Ross" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Ross</strong> : (To Monica) Stop saying, &quot;Blood&quot; to strangers.</p><p><img src="'+r+'" alt="Monica" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Monica</strong> : (to the couple on her left) So, how about you huh? How do you know the happy couple?</p><p><img src="'+o+'" alt="The Second Guest" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>The Second Guest</strong> : We went to college with both of them and now we live next door.</p><p><img src="'+r+'" alt="Monica" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Monica</strong> : Okay, you‘re fine.</p><blockquote><p>[Scene: Iridium Restaurant, Phoebe and Joey are looking at the menus as the waiter comes to take their order.]</p></blockquote><p><img src="'+o+'" alt="The Waiter" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>The Waiter</strong> : Hey!</p><p><img src="'+e+'" alt="Phoebe" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Phoebe</strong> : Hey!</p><p><img src="'+o+'" alt="The Waiter" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>The Waiter</strong> : Are you guys ready?</p><p><img src="'+e+'" alt="Phoebe" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Phoebe</strong> : Yes! I will have the green salad, umm the house salad, and water‘s fine.</p><p><img src="'+o+'" alt="The Waiter" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>The Waiter</strong> : Okay.</p><p><img src="'+e+'" alt="Phoebe" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Phoebe</strong> : Okay.</p><p><img src="'+o+'" alt="The Waiter" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>The Waiter</strong> : (To Joey) And for you sir?</p><p><img src="'+a+'" alt="Joey" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Joey</strong> : Yeah, this slow roasted salmon, just how slow are we talkin‘ here?</p><p><img src="'+o+'" alt="The Waiter" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>The Waiter</strong> : It‘s uh, it‘s already been roasted.</p><p><img src="'+a+'" alt="Joey" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Joey</strong> : Ohh, then no. Maybe I should hear those specials again.</p><p><img src="'+e+'" alt="Phoebe" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Phoebe</strong> : Oh Joey, we‘ve heard the specials three times! Okay? There‘s prime rib, mahi mahi, and a very special lobster ravioli. (She grabs his menu and hands it to the waiter.)</p><p><img src="'+o+'" alt="The Waiter" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>The Waiter</strong> : Actually we‘re out of the lobster ravioli. (Putting Joey‘s menu under his arm.)</p><p><img src="'+a+'" alt="Joey" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Joey</strong> : Oh well, that changes everything! (Grabs his menu and starts looking at it again. The waiter leaves.) Y‘know what Pheebs?</p><p><img src="'+e+'" alt="Phoebe" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Phoebe</strong> : Huh?</p><p><img src="'+a+'" alt="Joey" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Joey</strong> : You were right before. I mean, friends are so important.</p><p><img src="'+e+'" alt="Phoebe" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Phoebe</strong> : (checking her watch) Yeah, I‘m very wise. I know.</p><p><img src="'+a+'" alt="Joey" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Joey</strong> : Y‘know-y‘know what I really want?</p><p><img src="'+e+'" alt="Phoebe" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Phoebe</strong> : What?</p><p><img src="'+a+'" alt="Joey" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Joey</strong> : Is to have a long, long talk. Y‘know? Get Joey out on the open road and really open him up.</p><p><img src="'+o+'" alt="The Waiter" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>The Waiter</strong> : (returning) Any progress?</p><p><img src="'+a+'" alt="Joey" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Joey</strong> : Yes! I will have the lobster ravioli.</p><p><img src="'+e+'" alt="Phoebe" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Phoebe</strong> : God Joey, this is taking forever!</p><p><img src="'+a+'" alt="Joey" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Joey</strong> : What‘s the rush? What?</p><p><img src="'+e+'" alt="Phoebe" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Phoebe</strong> : W-wI justit‘s thatI havey‘know I have-I have an appointment. And it‘s very important.</p><p><img src="'+a+'" alt="Joey" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Joey</strong> : Whoa-whoa, what is it?</p><p><img src="'+e+'" alt="Phoebe" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Phoebe</strong> : Well It‘s a date.</p><p><img src="'+a+'" alt="Joey" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Joey</strong> : A date?! No, no Pheebs you-you must be mistaken, because I know you wouldn‘t schedule a date on the same night you have plans with a friend!</p><p><img src="'+e+'" alt="Phoebe" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Phoebe</strong> : Come on Joey, don‘t make me feel badly about this.</p><p><img src="'+a+'" alt="Joey" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Joey</strong> : No, I‘m gonna!! That‘s right! Yeah, you made me feel really guilty about goin‘ out with that girl! Like-like-like I did something terrible to you! And now Pheebs, you‘re doing the same thing!</p><p><img src="'+e+'" alt="Phoebe" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Phoebe</strong> : ThatIt‘s not the same thing! This is totally different! This is with David! Remember David, the scientist guy? Okay, he‘s very special to me.</p><p><img src="'+a+'" alt="Joey" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Joey</strong> : Okay, well my girl from the other night was special. She was a scientist too!</p><p><img src="'+e+'" alt="Phoebe" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Phoebe</strong> : She was?</p><p><img src="'+a+'" alt="Joey" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Joey</strong> : Well, she graduated from high school!</p><p><img src="'+e+'" alt="Phoebe" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Phoebe</strong> : Okay, whatever. Y‘know what? I don‘t have time to convince you because he‘s only here for four hours, and I‘m gonna go see him! (Gets up and leaves.)</p><p><img src="'+a+'" alt="Joey" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Joey</strong> : Fine!</p><p><img src="'+e+'" alt="Phoebe" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Phoebe</strong> : Yeah!</p><p><img src="'+a+'" alt="Joey" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Joey</strong> : Fine!</p><p><img src="'+e+'" alt="Phoebe" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Phoebe</strong> : Yeah! (She exits.)</p><p><img src="'+a+'" alt="Joey" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Joey</strong> : (to the waiter) What are you still doin‘ here?! I told you, lobster ravioli!</p><blockquote><p>[Scene: Outside Central Perk, Phoebe is running up to meet David.]</p></blockquote><p><img src="'+e+'" alt="Phoebe" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Phoebe</strong> : Hey!</p><p><img src="'+o+'" alt="David" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>David</strong> : Hey! Oh, I was just about to leave. I-I-I-I didn‘t think you were coming.</p><p><img src="'+e+'" alt="Phoebe" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Phoebe</strong> : Oh, I wouldn‘t miss this.</p><p><img src="'+o+'" alt="David" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>David</strong> : Well, I‘m very glad you‘re here. (Kisses her hand.)</p><p><img src="'+e+'" alt="Phoebe" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Phoebe</strong> : Oh, you‘re such a gentleman. (Grabs his arm.) Come on! We‘re going to my place! (Drags him off to her place.)</p><blockquote><p>[Scene: Joey and Rachel&#39;s, Rachel is eating the cheesecake and Chandler enters and catches her in the act.]</p></blockquote><p><img src="'+t+'" alt="Chandler" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Chandler</strong> : Are you eating the cheesecake without me?!</p><p><img src="'+i+'" alt="Rachel" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Rachel</strong> : (with a mouthful) Mm-mmm. (Nods no.)</p><p><img src="'+t+'" alt="Chandler" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Chandler</strong> : I will give you a hundred dollars to whistle right now. (She tries to whistle and blows little chunks of cheesecake out of her mouth.) How can you eat the cheesecake without me?!</p><p><img src="'+i+'" alt="Rachel" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Rachel</strong> : Oh, what are you going to do?! Are you gonna go run tell Monica?! Are you gonna tell Joey?! No! Because then you will have to tell them what we did! We are dessert stealers! We are living outside the law!</p><p><img src="'+t+'" alt="Chandler" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Chandler</strong> : Y‘know what? I don‘t trust you with this cake anymore! And I got it first, and I‘m takin‘ it back! (Grabs the cheesecake and heads for his apartment.)</p><p><img src="'+i+'" alt="Rachel" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Rachel</strong> : What?! What?!</p><p><img src="'+t+'" alt="Chandler" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Chandler</strong> : Oh yes!</p><p><img src="'+i+'" alt="Rachel" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Rachel</strong> : Wait a minute!</p><p><img src="'+t+'" alt="Chandler" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Chandler</strong> : Oh yes!</p><p><img src="'+i+'" alt="Rachel" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Rachel</strong> : Oh no-no-no-no-no, no you don‘t!</p><blockquote><p>[Cut to Chandler and Monica‘s as they enter.]</p></blockquote><p><img src="'+t+'" alt="Chandler" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Chandler</strong> : Oh yes! Oh yes!</p><p><img src="'+i+'" alt="Rachel" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Rachel</strong> : You think I trust you with it?! No! We‘re gonna split it! You take half and I take half!</p><p><img src="'+t+'" alt="Chandler" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Chandler</strong> : Well that‘s not fair, you‘ve already had some!</p><p><img src="'+i+'" alt="Rachel" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Rachel</strong> : What? Oh, well then y‘know what? I think Monica would be very interested to know that you called her cheesecake dry and mealy.</p><p><img src="'+t+'" alt="Chandler" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Chandler</strong> : What do we use to split it?</p><p><img src="'+i+'" alt="Rachel" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Rachel</strong> : Okay! (Grabs a knife and cuts it in half.) All right, pick a half.</p><p><img src="'+t+'" alt="Chandler" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Chandler</strong> : (examining the cake) Okay well, this side looks bigger. Uh There‘s more crust on this side. Y‘know? So, maybe if I measured</p><p><img src="'+i+'" alt="Rachel" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Rachel</strong> : Oh for God sake just pick a piece!</p><p><img src="'+t+'" alt="Chandler" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Chandler</strong> : All right, I‘ll pick that one. (Points.)</p><p><img src="'+i+'" alt="Rachel" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Rachel</strong> : That‘s also the smaller piece. (Puts the piece onto a plate.) Okay, there you go. Enjoy your half my friend, but that is it. No sharing. No switching, and don‘t come crying to me if you eat your piece too fast. (As she‘s saying that she is backing out the door, when she finishes she turns around to return to her place, stumbles and drops the cheesecake on the floor.) Oh!!!!</p><p><img src="'+t+'" alt="Chandler" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Chandler</strong> : (gloatingly and holding his piece) Ohhh!</p><p><img src="'+i+'" alt="Rachel" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Rachel</strong> : Okay, you gotta give me some of your piece.</p><p><img src="'+t+'" alt="Chandler" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Chandler</strong> : Oh-ho-ho-ho-no! No! No switching! No sharing, and don‘t come crying to me! Ha-ha-ha! I may just sit here and have my cake all day! Just sit here in the hallway and eat my (Rachel knocks the plate from his hand and it falls on the floor. That process leaves just the forkful Chandler has, Rachel starts to go after that little bit and Chandler retreats into his apartment.)</p><blockquote><p>[Scene: Cousin Frannie‘s Wedding Reception, Monica and Ross are sitting at the table, alone, as a woman approaches.]</p></blockquote><p><img src="'+o+'" alt="The Woman" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>The Woman</strong> : Ross, sweetheart!</p><p><img src="'+s+'" alt="Ross" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Ross</strong> : Oh, hey Aunt Millie.</p><p><img src="'+o+'" alt="Aunt Millie" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Aunt Millie</strong> : Isn‘t it a beautiful wedding?!</p><p><img src="'+s+'" alt="Ross" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Ross</strong> : Yes, yes it is. It‘s uh (Aunt Millie uses this opportunity to grab Ross and kiss him on the lips. After she leaves Ross quickly wipes his mouth with a napkin.) Every time on the lips! Why?! Why on lips?!</p><blockquote><p>(Cousin Frannie and her husband enter.)</p></blockquote><p><img src="'+r+'" alt="Monica" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Monica</strong> : Here‘s Frannie. Hmm, won‘t she be happy to see me? (Starts to get up and greet Frannie.)</p><p><img src="'+s+'" alt="Ross" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Ross</strong> : Now wait a minute, you be nice! All right? I didn‘t bring you here so you can ambush her.</p><p><img src="'+r+'" alt="Monica" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Monica</strong> : Frannie was the one who found your Playboys and showed them to mom.</p><p><img src="'+s+'" alt="Ross" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Ross</strong> : That bitch! (He gets up and they go over to ambush Frannie. Monica taps on Frannie‘s shoulder.)</p><p><img src="'+l+'" alt="Frannie" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Frannie</strong> : (turning around) Monica! What</p><p><img src="'+r+'" alt="Monica" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Monica</strong> : Am I doing here? Why? Surprised to see me? Ross brought me. How do you like that?!</p><p><img src="'+s+'" alt="Ross" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Ross</strong> : (to Frannie) Hi Frannie, congratulations.</p><p><img src="'+r+'" alt="Monica" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Monica</strong> : You invite my brother, you invite my whole family, and not me?! Why?! WhatWhy wouldn‘t you want me at your wedding? What could I have possibly done?! (Frannie‘s husband walks up.) Stuart!</p><p><img src="'+l+'" alt="Frannie" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Frannie</strong> : I believe you know my husband.</p><blockquote><p>(Monica is shocked into silence.)</p></blockquote><p><img src="'+s+'" alt="Ross" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Ross</strong> : So it‘s really a question of who could you have possibly done.</p><blockquote><p>[Scene: Outside Central Perk, David has a cab waiting to take him to the airport and he‘s saying goodbye to Phoebe.]</p></blockquote><p><img src="'+o+'" alt="David" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>David</strong> : Oh, I hate this but I-I-I have to go. I-I can‘t miss my flight.</p><p><img src="'+e+'" alt="Phoebe" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Phoebe</strong> : Are you sure? I‘ll bet there‘s another flight to Minsk in like</p><p><img src="'+o+'" alt="David" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>David</strong> : July. Umm, (He speaks Russian.)</p><p><img src="'+e+'" alt="Phoebe" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Phoebe</strong> : That‘s really beautiful. What does it mean?</p><p><img src="'+o+'" alt="David" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>David</strong> : Please, clean my beakers. I don‘t get out of the lab much.</p><p><img src="'+e+'" alt="Phoebe" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Phoebe</strong> : That‘s good. I got to admit, I thought it was something else.</p><p><img src="'+o+'" alt="David" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>David</strong> : Yeah, I Well I really actually wanted to say umm, that, but um, I figured I probably shouldn‘t because y‘know, Ihave to leave.</p><p><img src="'+e+'" alt="Phoebe" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Phoebe</strong> : You‘re right! You‘re right. Don‘t say it.</p><p><img src="'+o+'" alt="David" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>David</strong> : I-I do though.</p><p><img src="'+e+'" alt="Phoebe" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Phoebe</strong> : I do too. (They kiss.)</p><p><img src="'+o+'" alt="David" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>David</strong> : Bye Phoebe. (He gets in and the cab drives off. Joey walks up and witnesses that event.)</p><p><img src="'+e+'" alt="Phoebe" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Phoebe</strong> : (seeing him) Okay, now‘s not the time Joey. All right? You can yell at me tomorrow.</p><p><img src="'+a+'" alt="Joey" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Joey</strong> : No! No! No Pheebs, I‘m not gonna yell at you. I just y‘know, started thinking about you and David and Iremember how bummed you were the first time he left. And I just Oh Pheebs, come here. (He hugs her.) Are you okay?</p><p><img src="'+e+'" alt="Phoebe" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Phoebe</strong> : No I‘m not okay. The only guy I‘ve ever been crazy about has gone to Minsk and I may neverI may never see him again. (Crying.)</p><p><img src="'+a+'" alt="Joey" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Joey</strong> : Hey, y‘know you could always visit him.</p><p><img src="'+e+'" alt="Phoebe" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Phoebe</strong> : Oh right, like they‘re gonna let me have a passport.</p><p><img src="'+a+'" alt="Joey" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Joey</strong> : Anything I can do? Whatever you need.</p><p><img src="'+e+'" alt="Phoebe" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Phoebe</strong> : WellButNow, if-if you can achieve positronic distillation of sub-atomic particles y‘know before he does, then he can come back. (They hug again.)</p><p><img src="'+a+'" alt="Joey" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Joey</strong> : I can give it a shot.</p><blockquote><p>[Scene: The Hallway, Chandler and Rachel are on their knees with forks trying to salvage what they can of the cheesecake off of the floor.]</p></blockquote><p><img src="'+i+'" alt="Rachel" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Rachel</strong> : Oh! Yay! Look! There‘s a piece that doesn‘t have floor on it!</p><p><img src="'+t+'" alt="Chandler" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Chandler</strong> : Stick to your side!</p><p><img src="'+i+'" alt="Rachel" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Rachel</strong> : Hey, come on now!</p><blockquote><p>(Joey finishes climbing the stairs and sees them. Chandler and Rachel both stop and look up at him. Joey sits down on the step.)</p></blockquote><p><img src="'+a+'" alt="Joey" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Joey</strong> : (pulls out a fork) All right, what are we havin‘? (Starts digging in.)</p><blockquote><p>Ending Credits</p></blockquote><blockquote><p>[Scene: Cousin Frannie‘s Wedding Reception, Ross and Monica are at the door and about to leave.]</p></blockquote><p><img src="'+r+'" alt="Monica" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Monica</strong> : Oh wait I forgot my wrap.</p><p><img src="'+s+'" alt="Ross" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Ross</strong> : What? Oh, okay. Wait here. (Goes to get it, but before he gets there Aunt Millie sits down on it forcing him to pull it out from behind her which gets her attention.)</p><p><img src="'+o+'" alt="Aunt Millie" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Aunt Millie</strong> : Hi sweetie! Are you leaving?</p><p><img src="'+s+'" alt="Ross" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Ross</strong> : Well</p><p><img src="'+o+'" alt="Aunt Millie" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Aunt Millie</strong> : Give us a kiss. Come on! Come on!</p><blockquote><p>(Ross hesitates then leans down trying to get her to kiss his cheek, but she moves his head around and kisses him on the lips again.)</p></blockquote><p><img src="'+s+'" alt="Ross" style="border-radius:50%;height:auto;max-height:23px;vertical-align:middle;"> <strong>Ross</strong> : Why?! Why on the lips?! (He wipes his mouth on Monica‘s wrap and walks off, leaving Aunt Millie stunned.)</p><blockquote><p>End</p></blockquote>',297)]))}const k=n(c,[["render",u],["__file","s07e11.html.vue"]]),f=JSON.parse('{"path":"/script/season%2007/s07e11.html","title":"The One With All The Cheesecakes","lang":"zh-CN","frontmatter":{"title":"The One With All The Cheesecakes","icon":"fa-solid fa-mug-hot","order":11,"article":false,"category":["Script","Friends"],"tag":["S07","E11"]},"headers":[],"git":{},"readingTime":{"minutes":29.76,"words":8929},"filePathRelative":"script/season 07/s07e11.md","excerpt":"<blockquote>\\n<p>The One With All The Cheesecakes</p>\\n</blockquote>\\n<blockquote>\\n<p>Written by: Shana Goldberg-Meehan Transcribed by: Eric Aasen With Help from: Aaron Howard-Miller</p>\\n</blockquote>\\n<blockquote>\\n<p>[Scene: Chandler and Monica‘s, Chandler is sitting at the kitchen table eating cheesecake. The box it came in is also on the table.]</p>\\n</blockquote>"}');export{k as comp,f as data};
